Audrey Hollander, Barbara Summer, Cytherea, Kayla Marie, Lauren Phoenix, Marlena, Melissa Lauren, Otto Bauer, Shy Love, Trina Michaels, Vanessa, Vanessa Lane, Venus, Veronica Jett

Award winning director Bridgette Kerkove takes you into the competitive world of modeling, where anything goes, but usually anything is clothes and going, is actually... Cumming Tempers run high when top models cohabitate in a palatial estate. Cat-fights, photo shoots and a whole lot of making up dominate this two hour glimpse into life in front of the camera! Spend a little face time, with the girls.
